})
export class InscriptionComponent {
  constructor(private t:Router ,private b:Router){}

  gotoinscriptionagence(){

    this.t.navigate(["/inscription-agence"])

}
gotoinscriptionclient(){
  this.b.navigate(["/inscription-client"])
}
}
